import React from 'react'
import Container from '@material-ui/core/Container';
const Submit = () => {
    return (
        <Container maxWidth="sm" style={{ marginTop: '4rem' }}>
        <h3>Thank you for submitting, we will be in touch with you..!</h3>
      </Container>
    );
}

export default Submit;
